// Import the functions you need from the SDKs you need
import * as firebase_auth from "firebase/auth";
import * as firebase from "firebase-compat";
import { getAnalytics } from "firebase/analytics";




// FIREBASE CREDENTIALS
const firebaseConfig = {
    apiKey: "AIzaSyA4HFfvZFe0tjEAVteYdLtQ8JH1q30JStY",
    authDomain: "ticvoter.firebaseapp.com",
    projectId: "ticvoter",
    storageBucket: "ticvoter.appspot.com",
    messagingSenderId: "995667316327",
    appId: "1:995667316327:web:8a423933dec51878428ec2",
    measurementId: "G-2TVKHM2NJ5"
};




// Initialize Firebase
let app;
if (firebase.apps.length === 0) {
    const app = initializeApp(firebaseConfig);
    const analytics = getAnalytics(app);
}
else{
    app = firebase.app()
}


const auth = firebase_auth.getAuth()
export {auth};
